import React, { Component } from 'react'

//import $ from 'jquery';


var Refresh = React.createClass({
  

  render: () => {
      return (
          <div>
              <input type="submit" value="Search"  />
              
          </div>
      );
  }
});


export class Users extends Component {
  render() {
    return (
      <div>
          <header id="users">
              <div className="container">
                   <Refresh/>
              </div>
          </header>
      </div>
    );
  }
}

export default Users;
